import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import Sdata from "./Sdata";
// console.log(Sdata[0]);

ReactDOM.render(
  <>
    <h1>List of Series</h1>

    {Sdata.map((val) => {
      return (
        <Card
          imgSrc={val.imgSrc}
          sname={val.sname}
          title={val.title}
          links={val.links}
        />
      );
    })}
  </>,
  document.getElementById("root")
);
